import React, { useState } from "react";
import {
  Box,
  Flex,
  Link,
  Menu,
  MenuButton,
  MenuList,
  MenuItem,
  IconButton,
  useColorMode,
  Spacer,
} from "@chakra-ui/react";
import { HamburgerIcon, CloseIcon } from "@chakra-ui/icons";

const Navbar = () => {
  const { colorMode, toggleColorMode } = useColorMode();
  const [isOpen, setIsOpen] = useState(false);

  const handleToggle = () => {
    setIsOpen(!isOpen);
  };

  return (
    <Flex p={4} bg={colorMode === "dark" ? "gray.800" : "gray.100"} alignItems="center">
      <Box>
        <img src="files/images/logo.png" alt="Logo" style={{ width: "50px" }} />
      </Box>
      <Spacer />
      <Box display={{ base: "none", md: "flex" }}>
        <Flex alignItems="center">
          <Link mr={6} color={colorMode === "dark" ? "white" : "black"} href="/">
            Home
          </Link>
          <Link mr={6} color={colorMode === "dark" ? "white" : "black"} href="/about">
            About
          </Link>
          <Link mr={6} color={colorMode === "dark" ? "white" : "black"} href="/services">
            Services
          </Link>
          <Menu>
            <MenuButton as={Link} color={colorMode === "dark" ? "white" : "black"}>
              More
            </MenuButton>
            <MenuList bg={colorMode === "dark" ? "gray.700" : "gray.100"}>
              <MenuItem
                bg={colorMode === "dark" ? "gray.700" : "gray.100"}
                color={colorMode === "dark" ? "white" : "black"}
                as={Link}
                href="/contact"
              >
                Contact
              </MenuItem>
              <MenuItem
                bg={colorMode === "dark" ? "gray.700" : "gray.100"}
                color={colorMode === "dark" ? "white" : "black"}
                as={Link}
                href="/faq"
              >
                FAQ
              </MenuItem>
            </MenuList>
          </Menu>
        </Flex>
      </Box>
      <Box display={{ base: "flex", md: "none" }}>
        <IconButton
          icon={isOpen ? <CloseIcon /> : <HamburgerIcon />}
          variant="outline"
          onClick={handleToggle}
        />
      </Box>
      {isOpen && (
        <Box
          pos="fixed"
          top="0"
          right="0"
          h="100%"
          w="200px"
          bg={colorMode === "dark" ? "gray.800" : "gray.100"}
          zIndex="999"
          boxShadow="-2px 0 4px rgba(0, 0, 0, 0.1)"
        >
          <Flex direction="column" p={4} alignItems="flex-start">
            <MenuItem
              bg={colorMode === "dark" ? "gray.700" : "gray.100"}
              color={colorMode === "dark" ? "white" : "black"}
              as={Link}
              href="/"
            >
              Home
            </MenuItem>
            <MenuItem
              bg={colorMode === "dark" ? "gray.700" : "gray.100"}
              color={colorMode === "dark" ? "white" : "black"}
              as={Link}
              href="/about"
            >
              About
            </MenuItem>
            <MenuItem
              bg={colorMode === "dark" ? "gray.700" : "gray.100"}
              color={colorMode === "dark" ? "white" : "black"}
              as={Link}
              href="/services"
            >
              Services
            </MenuItem>
            <MenuItem
              bg={colorMode === "dark" ? "gray.700" : "gray.100"}
              color={colorMode === "dark" ? "white" : "black"}
              as={Link}
              href="/contact"
            >
              Contact
            </MenuItem>
            <MenuItem
              bg={colorMode === "dark" ? "gray.700" : "gray.100"}
              color={colorMode === "dark" ? "white" : "black"}
              as={Link}
              href="/faq"
            >
              FAQ
            </MenuItem>
          </Flex>
        </Box>
      )}
    </Flex>
  );
};

export default Navbar;
